async def download_one(semaphore, session, x , y, z, basepath, name):
    t0 = time.time()

    if not os.path.exists(basepath):
        os.makedirs(basepath)
    path = basepath + "/" + name
    # 如果链接对应的图片已存在，则忽略下载
    if os.path.exists(path):  # 图片已存在
        return {
            'ignored': True  # 用于告知download_one()的调用方，此图片被忽略下载
        }

    url = "{}&x={}&y={}&z={}&udt={}".format(baseurls[(x + y) % 3], x, y, z, mapfeature)
    try:
        async with semaphore:
            async with session.get(url) as response:
                if response.status == 200:
                    image_content = await response.read()  # Binary Response Content: access the response body as bytes, for non-text requests
                else:
                    raise aiohttp.ClientError()
    except Exception as e:
        return {
            'failed': True  # 用于告知download_one()的调用方，请求此图片URL时失败了
        }

    async with aiofiles.open(path, 'wb') as f:
        await f.write(image_content)

    t1 = time.time()
    return {
        'failed': False  # 用于告知download_one()的调用方，此图片被成功下载
    }

def getBaiduImgParams(array, minZoom, maxZoom,to_do,semaphore, session):
    for i in range(len(array)):
        zoom = i + 1;
        if(zoom >= minZoom and zoom <= maxZoom):
            item = array[i]
            minx = item[0]
            miny = item[1]
            maxx = item[2]
            maxy = item[3]
            for j in range(minx, maxx + 1):
                for k in range(miny, maxy + 1):
                    to_do.append(download_one(semaphore, session,j ,k,zoom,
                                              "{}/{}/{}".format(basepath, zoom, j), "{}.jpg".format(k)))

async def download_many():
    async with aiohttp.ClientSession() as session:  # aiohttp建议整个应用只创建一个session，不能为每个请求创建一个seesion
        # 用于限制并发请求数量
        sem = asyncio.Semaphore(600)
        to_do = []
        getBaiduImgParams(areaXyMap.get("quanguo"), 1, 10, to_do, sem, session)
        getBaiduImgParams(privinces[0].get("zoomxys"), 11, 15, to_do, sem, session)
        getBaiduImgParams(countys[0].get("zoomxys"), 16, 18, to_do, sem, session)
        find_images = len(to_do)  # 发现的总图片链接数
        ignored_images = 0  # 被忽略的图片数
        visited_images = 0  # 请求成功的图片数
        failed_images = 0  # 请求失败的图片数

        to_do_iter = asyncio.as_completed(to_do)
        with progressbar.ProgressBar(max_value=len(to_do)) as bar:
            for i, future in enumerate(to_do_iter):
                result = await future
                if result.get('ignored'):
                    ignored_images += 1
                else:
                    if result.get('failed'):
                        failed_images += 1
                    else:
                        visited_images += 1
                bar.update(i)

    print('Find [{}] images, ignored [{}] images, visited [{}] images, failed [{}] images'.format(find_images, ignored_images, visited_images, failed_images))


